import React from 'react'
import { Link } from 'react-router-dom';


function New() {
 
    return (
    <div style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        gap:"10px"
    }}> 
        <Link to="/login">Нэвтрэх</Link>
        <Link to="/form">Хоол нэмэх</Link>
        <Link to="/piechart">Pie Chart</Link>
        <Link to="/cart">   
        <ShoppingCart size={32} />
        </Link>
    </div>

  )
}

export default New;
